(ns gp
  (:require [anglican.runtime :refer :all]
            [anglican.core :refer :all]
            [anglican.emit :refer [defquery with-primitive-procedures]]
            [anglican.stat :refer [empirical-distribution collect-predicts collect-by collect-results]]
