(def num-particles 10)
(def csis-states (take num-particles (infer :csis gp [test-data] :tcp-endpoint "tcp://localhost:6666")))
(compose
  (list-plot test-data)
  (apply compose
         (mapv (fn [[abc weight]] (plot (partial mean-func (vec (vals abc))) [0 5]
                                        ;:opacity weight
                                        :color "red")) 
               (vec (empirical-distribution (collect-results csis-states))))))
